import ExpenseItem from "./ExpenseItem";

const ExpensesList = (props) => {
  let expensesContent = <p>There are no items!!</p>;

  if (props.expenses.length > 0) {
    expensesContent = props.expenses.map((item) => {
      return (
        <ExpenseItem
          key={item.id}
          title={item.title}
          amount={item.amount}
          date={item.date}
        />
      );
    });
  }
};

export default ExpensesList;
